import React from 'react';
import TableRow from './tablerow';

class Table extends React.Component {

    constructor(props) {
        super(props);
        this.state = {type1: '0', type2: '0'}

        this.handleSubmit = this.handleSubmit.bind(this)
    }

    handleSubmit(event) {
        alert("Type1: " + this.state.type1 + "\nType2: " + this.state.type2)
        event.preventDefault();
    }

    render(){
        return (
            <table className="table table-dark table-hover mt-5">
                <thead>
                    <tr>
                    <th scope="col">Pokemon</th>
                    <th scope="col">Weakness</th>
                    <th scope="col">Resistance</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <form onSubmit={this.handleSubmit}>
                            <TableRow />
                            <td>Ground, Water, Grass</td>
                            <td>Fire, Ghost</td>
                            <TableRow />
                            <td>Ground, Water, Grass</td>
                            <td>Fire, Ghost</td>
                            <TableRow />
                            <td>Ground, Water, Grass</td>
                            <td>Fire, Ghost</td>
                            <TableRow />
                            <td>Ground, Water, Grass</td>
                            <td>Fire, Ghost</td>
                            <TableRow />
                            <td>Ground, Water, Grass</td>
                            <td>Fire, Ghost</td>
                            <TableRow />
                            <td>Ground, Water, Grass</td>
                            <td>Fire, Ghost</td>
                        </form>
                    </tr>
                </tbody>
            </table>
        );
    }
};

export default Table;
